import React, { useState, Fragment } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { makeStyles, useTheme } from '@material-ui/core/styles';

import { Paper, withStyles, Grid, TextField, Button, FormControlLabel, Checkbox } from '@material-ui/core';


import { Link, withRouter } from 'react-router-dom';
import { addLoad } from '../../actions/load';



const useStyles = makeStyles((theme) => ({

  margin: {

  },
  padding: {

  }

}));


const LoadForm = ({ formProps: { addLoad }}) => {

  const classes = useStyles();


  return (

    < Fragment >
        < div  className = { classes . root } >
            < Grid  container
                direction = "row"
                justify = "center"
                alignItems = "center"
                spacing = { 1 }
            >
                < Grid  item  md = { 12 }  xs = { 12 } >
                    // field for input firstname
                    < TextField
                        id = "firstName"
                        label = "Firstname"
                        margin = "normal"
                        variant = "outlined"
                    / >
                < / Grid >
                < Grid  item  md = { 12 }  xs = { 12 } >
                    // field for input firstname
                    < TextField
                        id = "lastName"
                        label = "Lastname"
                        margin = "normal"
                        variant = "outlined"
                    / >
                < / Grid >
            < / Grid >
            < Grid  container
                direction = "row"
                spacing = { 1 }
            >
                < Grid  item  md = { 12 }  xs = { 12 } >
                    < Grid  item  md = { 12 }  xs = { 12 } >
                        // field for input nickname
                        < TextField
                            id = "nickname"
                            label = "Nickname"
                            margin = "normal"
                            variant = "outlined"
                        / >
                    < / Grid >
                < / Grid >
            < / Grid >
        < / div >
    < / Fragment >
  )

}

LoadForm.propTypes = {
  addLoad: PropTypes.func.isRequired
};

export default connect(null, { addLoad })(withRouter(LoadForm));
